;

-- TH: represents sequence for class ID.
DROP SEQUENCE IF EXISTS public.class_class_id_seq CASCADE;
CREATE SEQUENCE public.class_class_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

-- TH: represents class object.
-- TH: drops table if exists, on cascade.
DROP TABLE IF EXISTS class_ CASCADE;
CREATE TABLE class_(
--
	id_           SERIAL        NOT NULL
	,course_      VARCHAR(50)   NOT NULL
	,term_        VARCHAR(50)   NOT NULL
	,section_     VARCHAR(50)   NOT NULL
	,description_ VARCHAR(500)  NOT NULL
	,UNIQUE(course_,term_,section_)
	,PRIMARY KEY(id_)
--
);

ALTER SEQUENCE public.class_class_id_seq OWNED BY public.class_.id_
;
ALTER TABLE ONLY public.class_ 
ALTER COLUMN id_
SET DEFAULT nextval('public.class_class_id_seq'::regclass)
;

-- TH: represents sequence for category ID.
DROP SEQUENCE IF EXISTS public.category_category_id_seq CASCADE;
CREATE SEQUENCE public.category_category_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

-- TH: represents category object per class.
-- TH: the total sum of weights from all categories per class does NOT need to be equal to 100%.
-- TH: drops table if exists, on cascade.
DROP TABLE IF EXISTS category_ CASCADE;
CREATE TABLE category_(
--
	id_             SERIAL             NOT NULL
	,name_          VARCHAR(50)        NOT NULL
	,weight_        DOUBLE PRECISION   NOT NULL
	,id_class_      INTEGER            NOT NULL   REFERENCES    class_(id_)   ON DELETE CASCADE
	,UNIQUE(id_class_,name_) -- ,weight_)
	,PRIMARY KEY(id_)
--
);

ALTER SEQUENCE public.category_category_id_seq OWNED BY public.category_.id_
;
ALTER TABLE ONLY public.category_ 
ALTER COLUMN id_ 
SET DEFAULT nextval('public.category_category_id_seq'::regclass)
;

-- TH: represents sequence for category ID.
DROP SEQUENCE IF EXISTS public.item_item_id_seq CASCADE;
CREATE SEQUENCE public.item_item_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

-- TH: represents item object per category, class.
-- TH: drops table if exists, on cascade.
-- TH: drops row   if exists, on cascade.
DROP TABLE IF EXISTS item_ CASCADE;
CREATE TABLE item_(
--
	id_             SERIAL             NOT NULL
	,name_          VARCHAR(50)        NOT NULL
	,point_max_     DOUBLE PRECISION   NOT NULL
	,id_category_   INTEGER            NOT NULL   REFERENCES category_(id_)   ON DELETE CASCADE
	,description_   VARCHAR(500)       NOT NULL
	,UNIQUE(name_,id_category_)
	,PRIMARY KEY(id_)
--
);

ALTER SEQUENCE public.item_item_id_seq OWNED BY public.item_.id_
;
ALTER TABLE ONLY public.item_ 
ALTER COLUMN id_ 
SET DEFAULT nextval('public.item_item_id_seq'::regclass)
;

-- TH: represents student object.
-- TH: drops table if exists, on cascade.
DROP TABLE IF EXISTS student_ CASCADE;
CREATE TABLE student_(
--
	id_                 SERIAL           NOT NULL
	,username_          VARCHAR(50)      NOT NULL
	,realname_          VARCHAR(50)      NOT NULL
	,UNIQUE(username_)
	,PRIMARY KEY(id_)
--
);

-- TH: represents grade per item, student.
-- TH: drops table if exists, on cascade.
DROP TABLE IF EXISTS item_grade_ CASCADE;
CREATE TABLE item_grade_(
	id_student_     INTEGER            NOT NULL  REFERENCES student_(id_)   ON DELETE CASCADE
	,id_item_       INTEGER            NOT NULL  REFERENCES    item_(id_)   ON DELETE CASCADE
	,point_actual_  DOUBLE PRECISION   NOT NULL
	,PRIMARY KEY(id_student_,id_item_)
);

-- TH: represents enrollment per class, student.
-- TH: drops table if exists, on cascade.
DROP TABLE IF EXISTS enrollment_ CASCADE;
CREATE TABLE enrollment_(
	id_student_     INTEGER            NOT NULL  REFERENCES student_(id_)   ON DELETE CASCADE
	,id_class_      INTEGER            NOT NULL  REFERENCES   class_(id_)   ON DELETE CASCADE
	,grade_         VARCHAR(2)         NOT NULL
	,PRIMARY KEY(id_student_,id_class_)
);

