DROP TABLE IF EXISTS log_item_ CASCADE;
CREATE TABLE log_item_(
	id_             INTEGER            NOT NULL
	,name_          VARCHAR(50)        NOT NULL
	,point_max_     DOUBLE PRECISION   NOT NULL
	,id_category_   INTEGER            NOT NULL
	,description_   VARCHAR(500)       NOT NULL
	,stamp          TIMESTAMP  NOT NULL
);


-- IMPORTANT: working.
-- TH: defines trigger funciton (i.e. process_log_item_).
-- TH: updates item_.name_ to be unique based on category_.name_.
CREATE OR REPLACE FUNCTION process_log_item_()
    RETURNS trigger
	AS $trigger_log_item_$
BEGIN
if 
	-- TH: pays attention to case sensitivity per pgAdmin release !!
	(TG_OP = 'INSERT')
then
	with
		get_id_item_ as (select new.id_ as id_item_)
		,get_id_category_ as (select new.id_category_ as id_category_)
		,get_item_name_ as (select new.name_ as item_name_)
		,get_category_name_ as 
			(
				select
					DISTINCT category_.name_ as category_name_
				from
					category_ , get_id_category_
				where
					category_.id_ = id_category_
				group by
					category_.name_
			)
		,set_item_name_ as
			(
				select
					*
				from
					(
						select 
							category_name_::text || '-' || item_name_::text
							as 
								item_name_unique_
						from 
							get_category_name_
							,get_item_name_
					) string_agg_sub_
				--	string_agg
				--	(
					--	get_category_name_.category_name_::text || '-' || get_item_name_.item_name_::text
					--	'Final' || 'Item' || 'Unique' || 'Experimental'
				--	) item_name_unique_
			)
		,update_item_sub_ as
			(
				update
					item_
				set
					name_ = item_name_unique_
				from 
					set_item_name_
				where
					id_   = (select id_item_ from get_id_item_)
			)
		insert 
			into 
				log_item_
			select 
				new.*
				,now()
	;
end if;
RETURN NULL;
END;
$trigger_log_item_$
LANGUAGE plpgsql
;


drop trigger if exists trigger_log_item_ on item_;
create
	trigger trigger_log_item_
after
	insert on item_
for each row 
	execute function
		process_log_item_()
;


